import React from 'react';

const List = (props) => {
    return props.people.map(person => {
      return (
        <> key={props.people.id} className="person">
          <img src={person.image} />
          <h3>{person.name}</h3>
          <p>{person.age}</p>
      </>
      )
    })
};

export default List;
